require 'date'
require 'time'

def translate(array_of_objects)

  train_hash = {}
  array_of_objects.each_with_index do |o, i|
    if i % 2 == 0 || i == 0
      o[:trip_update][:stop_time_update].each do |x|
        stop = x[:stop_id]
        arrival_times = x[:arrival][:time]
        train_hash[stop] = arrival_times
      end
    end
  end

  train_hash.collect do |k, v|
    # train_hash[k] = Time.at(v).to_datetime.strftime("%H:%M:%S")
    puts (Time.now - Time.parse(Time.at(v).to_datetime.strftime("%H:%M:%S")))*24/60
  end

  puts train_hash

end

